export function replacePlaceholders(
  xmlString: string,
  replacements: Record<string, string>,
): string {
  return xmlString.replace(/{(.*?)}/g, (_, key) => {
    if (key in replacements) {
      return replacements[key]
    } else {
      console.warn(`Placeholder {${key}} has no replacement value.`)
      return `{${key}}` // Keep the placeholder if no replacement is found
    }
  })
}

